import "./Flex.sass";
function Flex() {
    return(
        <div>
            <h1 class = "flex">Comfortable with: </h1>
            <br/> <br/> <br/> <br/>
            <h1 class = "flex">Java</h1>
        </div>
    )
}

export default Flex;
